import React from 'react';
import classes from "./Counter.module.css"

const Counter = () => {
    return (
        <div className={classes.counter}>
            <div className={classes.count_btn}>+</div>
            <div className={classes.quantity}>01</div>
            <div className={classes.count_btn}>-</div>
        </div>
    );
};

export default Counter;
